import Header from "./header/Header";
import About from "./about/About";
import Project from "./project/Project";
import './App.css'
import { useScrollbar } from 'react'


function App() {
  const scrollbarRef = useScrollbar()
  return (
    <div ref={scrollbarRef} className="App">
     <Header />
     <About />
     <hr />
     <Project />
    </div>
  );
}

export default App;
